import logo from './logo.svg';
import './App.css';
import {FiMenu} from "react-icons/fi";


function App() {
  return (
    <div className="App">
      <header className="App-header">
        <a href={'#'} className={'logo'} >COC-STATS</a>
        <ul>
            <li><a href={'#'}>Home</a></li>
            <li><a href={'#'}>About</a></li>
            <li><a href={'#'}>Clans</a></li>
            <li><a href={'#'}>Towns Hall</a></li>
            <li><a href={'#'}>Troops</a></li>
            <li><a href={'#'}>Contacts</a></li>
        </ul>

        <div className={''}><FiMenu/></div>
      </header>
    </div>
  );
}

export default App;
